import { useHistory } from "react-router";
import axios from "axios";
import React from "react";

export default function GetRecipeFromIngredients(props) {

    const [recipes, setRecipes] = React.useState([])

    React.useEffect(() => {
      axios.get('http://localhost:8080/recipe-ingredients/get-recipe-names', {params: {ingredientName1: this.state.ingredient} }).then((response) =>{
          setRecipes(response.data)
      });
    }, []);

    if(!recipes) {
        return null;
    }


    return (
        <>
            {recipes.map((recipe, index) => 
                                           <a href="/recipes" ><div key={recipe.id}> {recipe}</div><br></br></a>
                                            )}
        </>
    )

}
